import React from "react";
import "./wyniki.css";
import NewForm from "./Form";
import Card from "../UI/Card";

function Wyniki(props) {
  return (
    <li>
      <div>
        <Card>
          <NewForm onSaveDate={Wyniki} />
        </Card>
        <div>
          <Card>
            <ul>
              {props.opo.map((imie) => (
                <li>{imie.name}</li>
              ))}
            </ul>
          </Card>
        </div>
      </div>
    </li>
  );
}

export default Wyniki;
